--
-- Name: appliquer_correction_mono_multi(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.appliquer_correction_mono_multi(mot_param text) RETURNS text
    LANGUAGE plpgsql
    AS $$
DECLARE
    classification TEXT;
BEGIN
    -- Récupérer la classification et incrémenter le compteur
    UPDATE corrections_mono_multi 
    SET nombre_applications = nombre_applications + 1 
    WHERE mot = mot_param
    RETURNING classification_correcte INTO classification;
    
    RETURN classification;
END;
$$;


ALTER FUNCTION public.appliquer_correction_mono_multi(mot_param text) OWNER TO postgres;

