CREATE FUNCTION public.cleanup_expired_admin_sessions() RETURNS void
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
    UPDATE admin_sessions 
    SET is_active = false 
    WHERE is_active = true 
    AND heartbeat < (now() - interval '5 minutes');
END;
$$;


