    CONSTRAINT users_dispositif_check CHECK ((dispositif = ANY (ARRAY['HSP'::text, 'OPCO'::text]))),
    CONSTRAINT users_role_check CHECK ((role = ANY (ARRAY['admin'::text, 'formateur'::text, 'apprenant'::text, 'salarié'::text])))
);


