--
-- Name: apprenants_actifs; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.apprenants_actifs AS
 SELECT u.id,
    u.prenom,
    u.nom,
    u.dispositif,
    u.date_entree_formation,
    u.date_sortie_previsionnelle,
    u.date_fin_formation_reelle,
    u.statut_formation,
    u.date_suspension,
    u.motif_suspension,
    u.date_reprise_prevue,
    l.nom AS lieu_formation,
    l.couleur AS lieu_couleur,
    u.created_at,
        CASE
            WHEN (u.date_fin_formation_reelle IS NOT NULL) THEN u.date_fin_formation_reelle
            ELSE u.date_sortie_previsionnelle
        END AS date_fin_effective,
        CASE
            WHEN ((u.statut_formation)::text = 'termine'::text) THEN 'Terminé'::text
            WHEN ((u.statut_formation)::text = 'abandonne'::text) THEN 'Abandonné'::text
            WHEN ((u.statut_formation)::text = 'suspendu'::text) THEN 'Suspendu'::text
            WHEN (u.date_sortie_previsionnelle < CURRENT_DATE) THEN 'Dépassé'::text
            ELSE 'En cours'::text
        END AS statut_display
   FROM (public.users u
     LEFT JOIN public.lieux l ON ((u.lieu_formation_id = l.id)))
  WHERE ((u.role = 'apprenant'::text) AND (u.archive = false));


ALTER VIEW public.apprenants_actifs OWNER TO postgres;

