--
-- Name: planning_apprenants_enrichi; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.planning_apprenants_enrichi AS
 SELECT pa.id,
    pa.apprenant_id,
    u.prenom,
    u.nom,
    pa.jour,
    pa.creneau,
    pa.lieu_id,
    l.nom AS lieu_nom,
    l.couleur AS lieu_couleur,
    pa.actif,
    pa.created_at
   FROM ((public.planning_apprenants pa
     JOIN public.users u ON ((pa.apprenant_id = u.id)))
     LEFT JOIN public.lieux l ON ((pa.lieu_id = l.id)))
  WHERE ((pa.actif = true) AND (u.role = 'apprenant'::text) AND (u.archive = false));


ALTER VIEW public.planning_apprenants_enrichi OWNER TO postgres;

