--
-- Name: v_corrections_actives; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_corrections_actives AS
 SELECT 'syllabification'::text AS type_correction,
    corrections_syllabification.mot,
    corrections_syllabification.segmentation_correcte AS correction,
    NULL::character varying AS classification,
    corrections_syllabification.source,
    corrections_syllabification.admin_correcteur,
    corrections_syllabification.date_creation,
    corrections_syllabification.nombre_applications,
    corrections_syllabification.commentaire
   FROM public.corrections_syllabification
  WHERE ((corrections_syllabification.statut)::text = 'actif'::text)
UNION ALL
 SELECT 'mono_multi'::text AS type_correction,
    corrections_mono_multi.mot,
    NULL::text[] AS correction,
    corrections_mono_multi.classification_correcte AS classification,
    corrections_mono_multi.source,
    corrections_mono_multi.admin_correcteur,
    corrections_mono_multi.date_creation,
    corrections_mono_multi.nombre_applications,
    corrections_mono_multi.commentaire
   FROM public.corrections_mono_multi;


ALTER VIEW public.v_corrections_actives OWNER TO postgres;

